import React from "react";
import "./App.css";

import ShrimpSelling from "./Components/Orders/ShrimpSelling";
import ShrimpOrder from "./Components/Orders/ShrimpOrder";
import Header from "./Components/HomePage/Header";
function App() {
  return (
    <div className="App">
      <Header />
      <ShrimpSelling />
      <ShrimpOrder />
    </div>
  );
}

export default App;
